import React, { Component } from "react";
import SmallCard from './SmallCard';

class ContentRowTotales extends Component {

    constructor() {
        super();
        this.state = {
            cartProps: []
        }
    }

    componentDidMount() {
        fetch('http://localhost:3030/API/books/')
            .then(res => res.json())
            .then(data => this.setState({ cartProps: data.data }))
            .catch(e => console.log(e));


    }

    mouse() {
        const cardBody = document.querySelector('.card2');
        cardBody.classList.toggle('bg-secondary');
    };

    render() {
        return (
            <React.Fragment>

                <div className="row">

                    {cartProps.map((total, i) => {

                        return <SmallCard {...total} key={i} />

                    })}

                </div>
            </React.Fragment>
        )
    }
}

export default ContentRowTotales;
